message:
Art. 144. A segurança pública, dever do Estado, direito e responsabilidade de todos, é exercida para a preservação da ordem pública e da incolumidade das pessoas e do patrimônio, através dos seguintes órgãos:
I - polícia federal;
II - polícia rodoviária federal;
III - polícia ferroviária federal;
IV - polícias civis;
V - polícias militares e corpos de bombeiros militares.
VI - polícias penais federal, estaduais e distrital.

Vou aguardar... só espero o seguinte:

- Dolar não suba(real desvalorizar);
- Não venham com papo de tornar vacina obrigatória;
- Nada de + imposto ou taxas;

Se até o final do ano esses 3 itens não tiverem nenhum agravo... da para ficar um pouco + e esperar para ver no que vai dar...
